import React from 'react';
import styled from 'styled-components/native';

const Container = styled.View`
  flex: 1;
  background-color: white;
  justify-content: center;
  align-items: center;
`

const Title = styled.Text`
  font-size: 20px;
`


export const Homepage = () => {
    return (
        <Container>
            <Title>Hej</Title>
        </Container>
    )

}
